import logo from './logo.svg';
import './App.css';
import Navbar from './components/home/Navbar';
import {BrowserRouter as Router, Route} from 'react-router-dom'

function App() {
  return (
    <>
        <Routes>
        <Route path="/" element={<Navbar />} />
      </Routes>
    </>
  );
}

export default App;
